import React from 'react'

const ThanksText = () => {
    return (
        <div style={{ margin: 10 }}>
            <h2 style={{ marginTop: -5 }}>Thank you ! </h2>
            <hr />
            <span> You have completed the survey </span>
            <br />
            <span>Please let us know how you feel about the survey by clicking on 'Proceed'.</span>
        </div>
    )
}
export default ThanksText
